Every now and then I feel the need to slow down in a world where everyone is running. A slow morning, a slow day, or week or month, it’s necessary to protect my heart and my mind from any “unnecessary” external attack. 
@theslowlabel sweater is my perfect “second skin” when having those moments. It’s like a hug, that kind of hug that I’m giving to myself to remember that everything, sooner or later, will be alright. 
Try have a slow moment yourself and thank me later. ✨ *ad
